import React, { useState } from "react";

function App() {
  const [count, setCount] = useState(0);
  return (
    <div className="App">
      <span className="add-cont">
        <span className="button" onClick={() => setCount(count - 1)}>
          -
        </span>
        <span className="button">{count}</span>
        <span className="button" onClick={() => setCount(count + 1)}>
          +
        </span>
      </span>
    </div>
  );
}

export default App;
